INSERT INTO `equipment` VALUES (1,'Aircraft Lighting',2,'2020-01-22','Aircraft lamps & lighting systems, including landing lights,taxing lights ,taxing lights,navigation lights & flood lights.'),(2,'Eagle Tugs Tow Tractors',3,'2020-01-01','With towing capacity up to 180,000 lbs., Eagle tugs & tow tractors are the only aircraft vehicles in their class with all wheel drive and limited slip differential features'),(3,'AERO Tire Service Trailer',2,'2020-01-22','New AERO Specialties aircraft tire service trailer built to accommodate (2) aircraft tires, jacks'),(4,'Hydraulic Power Units',3,'2020-01-10','The EO-20/20 air-powered hydraulic mini-mule is a compact pump with a lot of kick. '),(5,'General Aviation FTD(Flat Tire Dolly)',2,'2020-01-23','The GA FTD Aircraft Flat Tire Dolly Towbar can be used to tow most aircraft with a nose wheel gross weight of up to 6,000 lbs. This towbar can be used in cases when it is necessary to lower the tail of the aircraft to get into some T-Hangars. The GA FTD is designed to be easy on the nose gear; the strap and tires absorb abrupt towing starts and stops. Comes complete with winch.'),(6,'Stair Trucks',5,'2019-11-07','Chassis: 2017 Ford F-350\r\nEngine: 6.2L Triton V-8, gasoline, 316 hp., block heater\r\nSteps: 48? wide (122 cm)\r\nPlatform: 72? wide x 151? deep (183 x 384 cm)'),(7,'Dual Heating & AC Units',5,'2019-12-21','ACU-302 Series Conditioned Air Units comprise a line of diesel-electric and utility-powered electric air conditioning and heating units designed to service narrow body, regional jet and commuter aircraft worldwide. '),(8,'SiPsHitch™ Linear Force Monitoring System',3,'2019-07-19','The SiPsHitch™ Linear Force Monitoring System is a revolutionary aviation safety product that can be added to aircraft pushback tugs and tow tractors to alert operators to potential overstress situations.'),(9,'AERO 12-Ton Axle Jacks (6-Inch Lift)',1,'2020-01-18','Introducing AERO Specialties 12-ton axle jacks. These jacks are used to lift aircraft for maintenance purposes. '),(10,'AERO 1-Bottle Oxygen or Nitrogen Transport Handcart',2,'2020-02-06','AERO Specialties 1-Bottle Tilting Hand-movable Oxygen/Nitrogen System Service Cart (cart only) with retractable casters. '),(11,'Aero 3-Stage Maintenanace Stand ',5,'2020-01-22','Base, stairs and platform stay parallel at any height position');
